import React from 'react';

import ProjectCard from './ProjectCard';
import { Projects } from '../styles';

const projects = [
    {
        id: 1,
        name: '',
        description: '',
        stack: '',
        github: '',
        url: '',
        img: ''
    },
    {
        id: 2,
        name: '',
        description: '',
        stack: '',
        github: '',
        url: '',
        img: ''
    },
    {
        id: 3,
        name: '',
        description: '',
        stack: '',
        github: '',
        url: '',
        img: ''
    }
]

export default () => {
    return (
        <Projects id='projects'>
            <h1>Projects</h1>
            {projects.map(project => {
                return <ProjectCard/>
            })}
        </Projects>
    )
}
